import React from 'react';
import '../../App.css';
import './Pages.css';
import FeaturedProjectSection from'../FeaturedProjectSection/FeaturedProjectSection.js'

function Home() {
  return (
      <>
        <p>
          <b>Nice to meet you! </b>
            I am an Information Systems major at Carnegie Mellon University minoring in Human Computer Interaction, Design, and Computer Science. I hope to use my skills to help others or bring them a unique experience.  
        </p>
        <FeaturedProjectSection
          title="30 Day Adulting"
          summary="Developing an adulting challenge iOS application to use social influence principles to effectively teach and encourage cybersecurity habits."
          component="thirty_day_adulting"
        />
        <FeaturedProjectSection
          title="Cross Country Communications"
          summary="Developing an adulting challenge iOS application to use social influence principles to effectively teach and encourage cybersecurity habits."
          component="thirty_day_adulting"
        />
        <FeaturedProjectSection
          title="30 Day Adulting"
          summary="Developing an adulting challenge iOS application to use social influence principles to effectively teach and encourage cybersecurity habits."
          component="thirty_day_adulting"
        />
      </>
  );
}

export default Home;
